ControlledAndUncontrolled.parameters = Object.assign({
  storySource: {
    source: "renderComponent(html<DialogStoryArgs>`\n  <div>\n    <fluent-text block>\n      <span>\n        Employ the open attribute to dictate the dialog's visibility state. This method offers a declarative approach,\n        where the dialog's visibility is determined by the presence or absence of the external open attribute, ensuring\n        the state is managed outside the component.\n      </span>\n    </fluent-text>\n    <br />\n    <fluent-text block><code>open</code></fluent-text>\n    <br />\n    <fluent-button @click=${(e: Event) => openDialogControlled(e, 'dialog-controlled')}>\n      Open Controlled Dialog\n    </fluent-button>\n    <br />\n    <br />\n    <fluent-text block>\n      <span>\n        Utilize the show and hide methods to manage the dialog's visibility. This approach allows the dialog to handle\n        its state internally, giving you a direct and programmatic way to toggle its display without relying on external\n        attributes.\n      </span>\n    </fluent-text>\n    <br />\n    <fluent-text block><code>Dialog.show()</code></fluent-text>\n    <fluent-text block><code>Dialog.hide()</code></fluent-text>\n    <br />\n    <fluent-button @click=${(e: Event) => openDialog(e, 'dialog-uncontrolled')}>Open Uncontrolled Dialog</fluent-button>\n    <br />\n    <fluent-dialog id=\"dialog-controlled\">\n      <div slot=\"title\">Controlled Dialog</div>\n      <fluent-button\n        appearance=\"transparent\"\n        icon-only\n        @click=\"${(e: Event, c) => closeDialogControlled(e, 'dialog-controlled')}\"\n        slot=\"title-action\"\n      >\n        ${dismissed20Regular}\n      </fluent-button>\n      <div>\n        <fluent-text block>\n          <span>\n            Employ the open attribute to dictate the dialog's visibility state. This method offers a declarative\n            approach, where the dialog's visibility is determined by the presence or absence of the external open\n            attribute, ensuring the state is managed outside the component.\n          </span>\n        </fluent-text>\n        <fluent-text block><code>open</code></fluent-text>\n      </div>\n      <br />\n\n      <fluent-button\n        slot=\"action\"\n        appearance=\"primary\"\n        @click=\"${(e: Event, c) => closeDialogControlled(e, 'dialog-controlled')}\"\n      >\n        Close Controlled Dialog\n      </fluent-button>\n      <fluent-button slot=\"action\">Do Something</fluent-button>\n    </fluent-dialog>\n    <fluent-dialog id=\"dialog-uncontrolled\">\n      <div slot=\"title\">Uncontrolled Dialog</div>\n      <fluent-button\n        appearance=\"transparent\"\n        icon-only\n        @click=\"${(e: Event, c) => closeDialog(e, 'dialog-uncontrolled')}\"\n        slot=\"title-action\"\n      >\n        ${dismissed20Regular}\n      </fluent-button>\n      <div>\n        <fluent-text block>\n          <span>\n            Utilize the <code>show</code> and <code>hide</code> methods to manage the dialog's visibility. This approach\n            allows the dialog to handle its state internally, giving you a direct and programmatic way to toggle its\n            display without relying on external attributes.\n          </span>\n        </fluent-text>\n        <br />\n        <fluent-text block><code>Dialog.show()</code></fluent-text>\n        <fluent-text block><code>Dialog.hide()</code></fluent-text>\n      </div>\n      <br />\n\n      <fluent-button\n        slot=\"action\"\n        appearance=\"primary\"\n        @click=\"${(e: Event, c) => closeDialog(e, 'dialog-uncontrolled')}\"\n      >\n        Close Uncontrolled Dialog\n      </fluent-button>\n      <fluent-button slot=\"action\">Do Something</fluent-button>\n    </fluent-dialog>\n  </div>\n`)"
  }
}, ControlledAndUncontrolled.parameters);
